BOOL WINAPI DllMain( HINSTANCE hinstDLL, DWORD fdwReason, LPVOID lpvReserved )
{
   HB_SYMBOL_UNUSED( hinstDLL );
   HB_SYMBOL_UNUSED( lpvReserved );

   switch( fdwReason )
   {
      case DLL_PROCESS_ATTACH:  /* for each new process */
#ifdef DEBUG
         MessageBox( 0, "We're in DLLMain", "1", 0 );
#endif
         hb_vmInit( FALSE );
         break;
      case DLL_PROCESS_DETACH:
         if( szResult )
            hb_xfree( szResult );
         hb_vmQuit();
         break;

      case DLL_THREAD_ATTACH:  /* SAME process, but thread-specific init. */
         break;
      case DLL_THREAD_DETACH:  /* SAME process, but thread-specific cleanup. */
         break;
   }
   return TRUE;

